import './App.css';
import Home from './Components/Home';
import UserDetail from './DetailPage/UserDetail';

function App() {
  return (
    <>

    <Routes>
        <Route path="/" element={ <Home/> } />
        <Route path="about" element={ <UserDetail/> } />
      </Routes>

    <Home/>

    </>
  );
}

export default App;
